func (eq *ExamQuery) loadNotifications(ctx context.Context, query *NotificationQuery, nodes []*Exam, init func(*Exam), assign func(*Exam, *Notification)) error {
	fks := make([]driver.Value, 0, len(nodes))
	nodeids := make(map[int32]*Exam)
	for i := range nodes {
		fks = append(fks, nodes[i].ID)
		nodeids[nodes[i].ID] = nodes[i]
		if init != nil {
			init(nodes[i])
		}
	}
	query.withFKs = true
	if len(query.ctx.Fields) > 0 {
		query.ctx.AppendFieldOnce(notification.FieldExamCode)
	}
	query.Where(predicate.Notification(func(s *sql.Selector) {
		s.Where(sql.InValues(s.C(exam.NotificationsColumn), fks...))
	}))
	neighbors, err := query.All(ctx)
	if err != nil {
		return err
	}
	for _, n := range neighbors {
		fk := n.ExamCode
		node, ok := nodeids[fk]
		if !ok {
			return fmt.Errorf(`unexpected referenced foreign-key "ExamCode" returned %v for node %v`, fk, n.ID)
		}
		assign(node, n)
	}
	return nil
}
